import { StatusBar } from 'expo-status-bar';
import * as React from 'react';
import { StyleSheet, Text, View, SafeAreaView } from 'react-native';
import { Provider as PaperProvider } from "react-native-paper";

import HomeScreen from './components/1_HomeScreen/HomeScreen';
import SwapNumbers from './components/1_HomeScreen/SwapNumbers';
import IntoTheDiamond from './components/1_HomeScreen/IntoTheDiamond';
import KeepMeInMemory from './components/1_HomeScreen/KeepMeInMemory';

import AuthScreen from './components/2_AuthScreen/AuthScreen';
import Login from './components/2_AuthScreen/Login';
import SignUp from './components/2_AuthScreen/SignUp';

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

const Stack = createStackNavigator();

const AppTab = createBottomTabNavigator();

export default function App() {

  return (
    <NavigationContainer>
      <AppTab.Navigator initialRouteName="Auth">
        <AppTab.Screen name="Auth" component={AuthScreen} />
        /*<Stack.Screen name="Login" component={Login} />
        <Stack.Screen name="SignUp" component={SignUp} />*/
        <AppTab.Screen name="Home" component={HomeScreen} />
        /*<Stack.Screen name="Swap Numbers" component={SwapNumbers} />
        <Stack.Screen name="Into the Diamond" component={IntoTheDiamond} />
        <Stack.Screen name="Keep Me in Memory" component={KeepMeInMemory} />*/
      </AppTab.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
